description:
As Blossom, Bubbles and Buttercup face off against Mojo Jojo, they may have found the one challenge that has them staying up past bedtime. The cast of the original series returns including Catherine Cavadini as Blossom, Tara Strong as Bubbles, and E.G. Daily as Buttercup with a special guest appearance by Ringo Starr as Fibonacci Sequins.

The Powerpuff Girls have always saved the world before bedtime, but Mojo Jojo is back with his most diabolical scheme yet. As Blossom, Bubbles and Buttercup face off with their enemy, the girls may have found the one challenge that has them staying up past bedtime.


